import React from 'react';
import { ReactDOM } from 'react-dom';
import './index.css';
import 'mdb-react-ui-kit/dist/css/mdb.min.css';
import App from './App';
import { Provider } from 'react-redux';
import store from './Redux/Store/Store';


ReactDOM.render(
  <Provider store={store}>
    <App />
  </Provider>
   
);
